import React from 'react'
import './contact.css';
const Contact = () => {
  return (
    <div id='contact'>
      <h1 className='contactPagetitle'>Contact Me</h1>
      <span className='contactDesc'>Please fill out the form.</span>

      <form className='Contact'></form>
    </div>
  )
}

export default Contact
